import React from "react";
import CodingPage from "../CodingPage/CodingPage";
import ContactPage from "../ContactPage/ContactPage";
import ComicsPage from "../ComicsPage/ComicsPage";
import profile from "../images/profile-photo.jpg";

const LandingPage = () => {
  return (
    <div className="content">
    {/* Hero Section */}
  <div className="mb-10">
  <h1 className="welcome-blurb">welcome to mattstyles.com</h1>

  {/* Profile Container */}
  <div className="profile-blurb">
    <img 
      src={profile} 
      alt="Profile" 
      className="profile-photo"
      style={{ width: "120px" }}
    />
    <p className="text-lg text-gray-600 profile-blurb">I write code and comics.</p> 
  </div>
</div>

      {/* Coding Section */}
      <CodingPage/>

      {/* Comics Section */}
      <ComicsPage/>

      {/* Contact Section */}
      <ContactPage/>
    </div>
  );
};

export default LandingPage;
